import * as o from "react";
import r from "../lib/SSRBase.es.js";
import c from "../defs/Octagon.es.js";
const t = o.forwardRef((a, e) => /* @__PURE__ */ o.createElement(r, { ref: e, ...a, weights: c }));
t.displayName = "OctagonIcon";
const s = t;
export {
  s as Octagon,
  t as OctagonIcon
};
